import math
n , m = list(map(int, input().split()))
nums = list(map(int, input().split()))
nums = [0,] + nums + [n,]
L = n + 1
cnt_x = min(int(math.sqrt(L)), m)
max_l = [0] * (cnt_x + 1)
for i in range(1, len(nums)):
    for j in range(i):
        if j < cnt_x + 1:
            max_l[j] = max(max_l[j], nums[i] - nums[i-j-1])
        else:
            break
for i in range(cnt_x + 1):
    max_l[i] = (max_l[i] - i * i)
print(max(max_l))
